import { Stack } from '@chakra-ui/react';
import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { authenticateUser } from '../services/login';
// import { getAuthenticateUser } from '../services/login';
const AuthUser = ({componentName}) => {

  const navigate = useNavigate()
  // const [user,setUser] = useState({});
  useEffect( () => { 
    authenticate();
  })
  const authenticate = async () => {
    const {status} = await authenticateUser('/dashboard')
    const [showPage, setShowPage] = useState(false)
    if(status !== 200)
      navigate('/login')
    else
    {
      setShowPage(true)
    }
      
      
  }
  // const loadUser = async () =>{
  //   const response = await getAuthenticateUser();
  //   setUser({...user, response})
  // }


  return (
    <div>
      {/* call the page */}
      showPage && <Stack>Dashboard</Stack>
    </div>

  )
}

export default AuthUser
